import React from 'react';
import './App.css';

import './style.css'
import App from './App'

import {BrowserRouter as Router, Route, Switch} from "react-router-dom"

 export default function Main (){
        return (
            <Router>
                <div>
                <Switch>
                    <Route  path="/" component={App}/>
                </Switch>
                </div>
            </Router>
        );
}
